import React from "react";
import {Link} from "react-router-dom";
import './App.css';


    function login() {

        return (
          <div>

<header className="home-header">
        </header>

        <form className = 'form'>
  <input placeholder="Username" type="text" required=""/>
  <input placeholder="Password" type="password" required=""/>

  <Link to="/home"><button>
              Confirm
            </button>
            </Link>
            </form>
          </div>
          
        );

    }




    
  export default login;
